		#pragma region CFormDialog
			CDialogs::CFormDialog::CFormDialog(IForm *active_form, const String &message, const String &caption, const Image &bmp, const bool confirmation):
				CForm(L"FormDialogs", nullptr, active_form->getRenderer()->CreateInstance()),
				m_pImage{ nullptr },
				m_pLabel{ nullptr },
				m_pButtonOk{ nullptr },
				m_pButtonNo{ nullptr },
				m_pButtonCancel{ nullptr },
				m_pContainerButtons{ nullptr },
				m_pContainerImage{ nullptr },
				m_pContainerMessage{ nullptr }
			{
				CLockRepaint lock{ this };
				CreateParams cp{ getCreateParams() };
				cp.Caption = caption;
				cp.HasSizeBox = false;
				cp.IsTopMost = true;
				cp.Size = Point{ 400, 200 };
				cp.State = WindowState::Hidden;
				setCreateParams(cp);
				QueryService()->setWindow(new CWindow());
				Application->QueryService()->Add(this);

				PointF client_size{ 0, 0 };

				m_pContainerButtons = new standard::CContainer(this);
				m_pContainerButtons->setAlign(Align::Bottom);

				if (!bmp.isEmpty())
				{
					m_pContainerImage = new standard::CContainer(this);
					m_pContainerImage->setWidth(32 + (float)bmp.Width);
					m_pContainerImage->setAlign(Align::Left);

					m_pImage = new standard::CImage(m_pContainerImage);
					m_pImage->setSize(PointF{ (float)bmp.Width, (float)bmp.Height });
					m_pImage->getTransform()->Translate(16, 16, 0);
					m_pImage->setBorderWidth(RectF{ 0, 0, 0, 0 });
					*m_pImage->getImage() = bmp;
					m_pImage->Update();
					client_size.X = 32 + (float)bmp.Width;
					client_size.Y = 32 + (float)bmp.Height;
				}

				PointF max_size{ (float)Application->Screen->getWidth() / 3, (float)Application->Screen->getHeight() * 0.9f };
				if (message.length() > 0)
				{
					m_pContainerMessage = new standard::CContainer(this);
					m_pContainerMessage->setAlign(Align::Client);

					m_pLabel = new standard::CLabel(m_pContainerMessage);
					IFont *font{ m_pLabel->getFont() };
					IPlatformFont *pf{ font->getPlatformFont(getRenderer()) };
					if (pf)
					{
						PointF size{ pf->getStringSize(message, font->Distance) };
						if (size.X > max_size.X - client_size.X - 32 && max_size.X >= 300)
						{
							StringArray lines;
							WordWrap(message, max_size.X - client_size.X - 32, pf, font->Distance, lines, size);
							m_pLabel->setMultiline(true);
							m_pLabel->setCaption(Implode(L"\n", lines));
							m_pLabel->setSize(size);
						}
						else
							m_pLabel->setCaption(message);
						client_size.X = ntl::Min<float>(max_size.X, client_size.X + size.X + 32);
						client_size.Y = ntl::Min<float>(max_size.Y, ntl::Max<float>(client_size.Y, 32 + size.Y));
						if (ntl::Round<int>(size.Y) >= bmp.Height)
							m_pLabel->getTransform()->Translate(16, 16, 0);
						else
							m_pLabel->getTransform()->Translate(16, std::round(((float)bmp.Height - size.Y) / 2 + 16), 0);
					}
				}

				m_pButtonOk = new standard::CButton(m_pContainerButtons);
				m_pContainerButtons->setHeight(32 + m_pButtonOk->getHeight());
				client_size.Y = ntl::Min<float>(max_size.Y, client_size.Y + 32 + m_pButtonOk->getHeight());
				if (confirmation)
				{
					client_size.X = ntl::Min<float>(max_size.X, ntl::Max<float>(client_size.X, m_pButtonOk->getWidth() * 3 + 64));
					float x{ std::round((client_size.X - 32 - m_pButtonOk->getWidth() * 3) / 2) };
					m_pButtonNo = new standard::CButton(m_pContainerButtons);
					m_pButtonCancel = new standard::CButton(m_pContainerButtons);
					m_pButtonOk->getTransform()->Translate(x, 16, 0);
					x += m_pButtonOk->getWidth() + 16;
					m_pButtonNo->getTransform()->Translate(x, 16, 0);
					x += m_pButtonOk->getWidth() + 16;
					m_pButtonCancel->getTransform()->Translate(x, 16, 0);

					m_pButtonOk->setCaption(Application->Translate->t(L"FormDialogs", L"Yes"));
					m_pButtonOk->OnClick = [](IControl *sender) { sender->getForm()->setModalResult(ModalResult::Yes); };

					m_pButtonNo->setCaption(Application->Translate->t(L"FormDialogs", L"No"));
					m_pButtonNo->OnClick = [](IControl *sender) { sender->getForm()->setModalResult(ModalResult::No); };

					m_pButtonCancel->setCaption(Application->Translate->t(L"FormDialogs", L"Cancel"));
					m_pButtonCancel->OnClick = [](IControl *sender) { sender->getForm()->setModalResult(ModalResult::Cancel); };
				}
				else
				{
					client_size.X = ntl::Min<float>(max_size.X, ntl::Max<float>(client_size.X, m_pButtonOk->getWidth() + 16));
					m_pButtonOk->getTransform()->Translate(std::round((client_size.X - m_pButtonOk->getWidth()) / 2), 16, 0);
					m_pButtonOk->setCaption(Application->Translate->t(L"FormDialogs", L"OK"));
					m_pButtonOk->OnClick = [](IControl *sender) { sender->getForm()->setModalResult(ModalResult::Ok); };
				}

				setClientSize(Round(client_size));
				setPosition(Point{ active_form->getLeft() + (active_form->getWidth() - ntl::Round<int>(client_size.X)) / 2, active_form->getTop() + (active_form->getHeight() - ntl::Round<int>(client_size.Y)) / 2 });

				OnClose = [](IForm *sender, CloseAction &action) {
					action = CloseAction::Free;
				};

				OnShow = [](IForm *sender) {
					sender->setPosition(sender->getCreateParams().Position);
					sender->Repaint();
					sender->OnShow = nullptr;
				};
			}

			size_t CDialogs::CFormDialog::SearchWordEnd(const String &message, const size_t start)
			{
				size_t result{ start + 1 };
				while (result < message.length() - 1)
				{
					if (std::isspace(message[result + 1]))
						return result;
					result++;
				}
				return message.length();
			}
