		#pragma region Helpers
			IForm *CDialogs::CreateDialog(const String &message, const String &caption, const Image &bmp, const bool confirmation)
			{
				if (m_pApplication->m_aWindows.size() == 0)
					return nullptr;
				bool succeeded{ false };
				PlatformHandle active_window{ m_pApplication->getActiveWindow(succeeded) };
				if (!succeeded || !(*reinterpret_cast<Window*>(&active_window)))
					return nullptr;
				CApplication::WINDOW *info{ nullptr };
				for (auto &i : m_pApplication->m_aWindows)
					if (i.Handle == active_window)
					{
						info = &i;
						break;
					}
				if (!info || !info->Form || !info->Form->getRenderer())
					return nullptr;
				return new CFormDialog(info->Form, message, caption, bmp, confirmation);
			}
		#pragma endregion
